<template>
    <div class="container marginTopNew">
        <h2 style="margin-top: 10px;"><img src="./assets/restaurant/restaurant.png" alt='restaurant_icon' class="input-icon-top" loading="lazy"/>Restaurant Details</h2>
        <div class="form-wrapper">
            <div class="form-header">
                <h3><img src="./assets/restaurant/form.png" alt='form_icon' class="form-icon-top" loading="lazy"/>Fill Restaurant Details</h3>
            </div>
            <div class="form-body">
                <div class="marginBottomNew">
                    <label for="name" class="form-label">Restaurant Name:</label>
                    <div class="input-with-icon">
                        <img src="./assets/restaurant/shop.png" alt='restaurant_icon' class="input-icon" loading="lazy"/>
                        <input type="text" v-model="restaurant.name" class="form-control" id="name"
                        required maxlength="30" placeholder="Enter Restaurant name" />
                    </div>
                    <span v-if="errors.name" class="text-danger">{{ errors.name }}</span>
                </div>
                <div class="marginBottomNew">
                    <label for="address" class="form-label">Address:</label>
                    <div class="input-with-icon1">
                        <img src="./assets/restaurant/location.png" alt='location_icon' class="input-icon" loading="lazy"/>
                        <textarea v-model="restaurant.address" class="form-control" id="address"
                        required maxlength="50" placeholder="Enter Address"></textarea>
                    </div>
                    <span v-if="errors.address" class="text-danger">{{ errors.address }}</span>
                </div>
                <div class="marginBottomNew">
                    <label for="description" class="form-label">Description:</label>
                    <div class="input-with-icon1">
                        <img src="./assets/restaurant/description.png" alt='description_icon' class="input-icon" loading="lazy"/>
                        <textarea v-model="restaurant.description" class="form-control" id="description" maxlength="100" placeholder="Describe your Restaurant features"></textarea>
                    </div>
                </div>
                <div class="marginBottomNew">
                    <label for="changeImage" class="form-label">Upload Image:</label>
                    <div class="input-with-icon">
                        <img src="./assets/restaurant/image.png" alt='image_icon' class="input-icon" loading="lazy"/>
                        <input type="file" class="form-control" id="changeImage" @change="onFileChange" />
                    </div>
                </div>
                <div class="marginBottomNew">
                    <label for="type" class="form-label">Restaurant Type:</label>
                    <div class="input-with-icon">
                        <img src="./assets/restaurant/list.png" alt='list_icon' class="input-icon" loading="lazy"/>
                        <select v-model="restaurant.type" class="form-select" id="type" required>
                            <option disabled value="">Select a type</option>
                            <option v-for="item in types" :key="item">{{ item }}</option>
                        </select>
                    </div>
                    <span v-if="errors.type" class="text-danger">{{ errors.type }}</span>
                </div>
            </div>
            <div class="form-footer d-flex justify-content-end">
                <button type="submit" class="btn btn-primary" @click="addRestaurant" :disabled="isSubmitting">
                    <span v-if="isSubmitting" class="spinner-border spinner-border-sm me-2" role="status" aria-hidden="true"></span>
                    <span v-else>Submit</span>
                </button>
            </div>
        </div>
    </div>
  <div class="modal fade" id="addedSuccessModal" tabindex="-1" aria-labelledby="addedSuccessModalLabel" aria-hidden="true" ref="addedSuccessModal">
        <div class="modal-dialog modal-dialog-centered">
            <div class="modal-content">
                <div class="modal-header">
                    <h5 class="modal-title modalHeader" id="loginModalLabel">Success</h5>
                    <button type="button" class="close buttonClose" data-dismiss="modal" aria-label="Close" @click.prevent="closeModal()">
                        <span aria-hidden="true">&times;</span>
                    </button>
                </div>
                <div class="modal-body">
                    <p class="modalParagraph">{{ restaurant.name }} Restaurant Added Successfully!.</p>
                </div>
                <div class="modal-footer">
                    <button type="submit" class="btn btn-success" id="addedSuccessButton" @click.prevent="addRestaurantModal" :disabled="isSubmitting">
                        <span v-if="isSubmitting" class="spinner-border spinner-border-sm me-2" role="status" aria-hidden="true"></span>
                        <span v-else>OK</span>
                    </button>
                </div>
            </div>
        </div>
    </div>
    <CreateLogsWord @logCreated="addLogToLogs" ref="createLogsComponent" />
    <ToasterWord ref="toaster" />
    <LoaderWord :loading="isLoading" />
</template>
<script>
  import { mapActions } from 'vuex';
  import ToasterWord from './ToasterWord.vue';
  import { Modal } from 'bootstrap';
  import axios from 'axios';
  import CreateLogsWord from './CreateLogsWord.vue';
  import LoaderWord from './LoaderWord.vue';

  export default {
    name: 'AdminWord',
    components: {
        ToasterWord,
        CreateLogsWord,
        LoaderWord,
  },
    data() {
      return {
        restaurant: {
          id: '',
          name: '',
          address: '',
          description: '',
          image: null,
          type: '',
          rating: 5,
        },
        errors: {},
        isLoading: false,
        isSubmitting: false,
        addedSuccessModal: null,
        types: ['Pure Veg', 'Non-Veg', 'Veg/Non-Veg', 'Fast-Food', 'Bakery', 'Chinese'],
        defaultDescription :"Food provides essential nutrients for overall health and well-being.",
        restaurantData:{},
        base64Images:"data:image/jpeg;base64,"
      };
    },
    mounted(){
        this.clearForm();
        this.toaster = this.$refs.toaster;
        this.addedSuccessModal = new Modal(this.$refs.addedSuccessModal);
        this.isLoading = true;

        setTimeout(() => {
          this.isLoading = false;
        }, 2000);
    },
    methods: {
      ...mapActions(['setRestaurant']),
      generateId() {
        return Math.floor(1000000000 + Math.random() * 9000000000).toString();
      },
      validateForm() {
        this.errors = {};
        let isValid = true;

      if (!this.restaurant.name) {
        this.errors.name = "Restaurant Name is required.";
        isValid = false;
      }
      if(!this.restaurant.address){
        this.errors.address = "Address is required.";
        isValid = false;
      }
      if(!this.restaurant.type){
        this.errors.type = "Type is required.";
        isValid = false;
      }

     return isValid;
    },
    async addRestaurant() {
        this.isLoading = true;
        this.isSubmitting = true;
        if (this.validateForm()) {
            this.restaurant.id = this.generateId();
            if (!this.restaurant.image) {
              this.restaurant.image = this.base64Images;
            }
                    const formData = new FormData();
                    formData.append('restaurantName', this.restaurant.name);
                    formData.append('restaurantAddress', this.restaurant.address);
                    formData.append('restaurantType', this.restaurant.type);
                    formData.append('restaurantRating', this.restaurant.rating);
                    if(!this.restaurant.description){
                        this.restaurant.description = this.defaultDescription;
                    }
                    formData.append('restaurantDescription', this.restaurant.description);
                    if (this.restaurant.image) {
                        formData.append('profileImage', this.restaurant.image);
                    }
                try {
                    const response = await axios.post('http://localhost:3000/auth/add-restaurant',  formData, { headers: {
                        'Content-Type': 'multipart/form-data'
                        }
                    });

                    this.restaurantData = response.data;
                    this.setRestaurant(this.restaurant);
                    this.$refs.createLogsComponent.createLog('Restaurant Added','Admin', this.restaurant.id);
                      setTimeout(() => {
                        this.addedSuccessModal.show();  
                      }, 1000);
                    
                } catch (error) {
                    this.setRestaurant(this.restaurant); 
                    this.showToast('Restaurant Added locally in Vuex!', 'success');
                    this.$refs.createLogsComponent.createLog('Restaurant Added', 'Admin Panel', this.restaurant.id);
                    setTimeout(() => {
                        this.addedSuccessModal.show();  
                      }, 1000);
                }
                finally {
                  setTimeout(() => {
                    this.isSubmitting = false;
                    this.isLoading = false;
                  }, 1000);
                }
        }
        else{
        this.showToast('Please fill the form !', 'error');
        setTimeout(() => {
          this.isSubmitting = false;
          this.isLoading = false;
        }, 1000);

      }
    },

    addLogToLogs(log) {
      console.log('Log Created:', log);
    },
    closeModal() {
        this.addedSuccessModal.hide();
      },
     addRestaurantModal(){  
        this.isSubmitting = true; 
            setTimeout(() => {
              this.isSubmitting = false;
              this.addedSuccessModal.hide();
          }, 100);
          setTimeout(() => {
           this.$router.push({ name: "Home" });
            }, 200);
      },
    clearForm() {
      this.restaurant.name = '';
      this.restaurant.address = '';
      this.restaurant.description = '';
      this.restaurant.type = '';
      this.restaurant.image = null;
    },
    showToast(msg, status) {
        if (this.toaster) {
            this.toaster.show(msg, status);
        } else {
            //console.error("Toaster instance not initialized.");
        }
    },
      onFileChange(event) {
        const file = event.target.files[0]; 
          if (file) {
            this.restaurant.image = file;
          } else {
            this.restaurant.image = null; 
          }
      },
    },
  };
  </script>
<style scoped>
.form-wrapper {
  display: flex;
  flex-direction: column;
  height: 100%;
  border: 1px solid #ddd;
  border-radius: 5px;
  overflow: hidden;
}

.form-header,
.form-footer {
  background-color: #f8f9fa;
  padding: 1rem;
  text-align: center;
  font-size: 1.2rem;
  font-weight: bold;
  flex-shrink: 0;
}

.form-body {
  padding: 1rem;
  overflow-y: auto;
  max-height: calc(100vh - 200px);
}

.input-icon-top{
    width: 40px;
    margin-right: 10px;
    margin-left: 10px;
}
.form-icon-top{
    width: 32px;
    margin-right: 10px;
}

.marginBottomNew {
  margin-bottom: 0.8rem;
}

.text-danger {
  font-size: 12px;
  margin-top: -8px;
  margin-bottom: 10px;
}

.input-with-icon {
  position: relative;
}

.input-with-icon img {
  position: absolute;
  top: 50%;
  left: 5px;
  transform: translateY(-50%);
  color: #999;
  width: 24px;
}

.input-with-icon .form-control,
.input-with-icon .form-select,
.input-with-icon1 textarea {
  padding-left: 35px;
}


.input-with-icon1 {
  position: relative;
}

.input-with-icon1 img {
  position: absolute;
  top: 30%;
  left: 5px;
  transform: translateY(-50%);
  color: #999;
  width: 24px;
}

.buttonClose {
  border: none;
  background-color: transparent;
  cursor: pointer;
  transition: background-color 0.3s ease, transform 0.3s ease;
  outline: none;
  padding: 8px;
}
.buttonClose:hover {
  background-color: rgba(51, 51, 51, 0.8);
  transform: scale(1.05);
  box-shadow: none;
  border: none;
}

.modalHeader{
  font-size: 28px;
  font-weight: 500;
  color: green;
}
.modalParagraph{
  font-size: 20px;
  font-weight: 500;
  text-transform: capitalize;
  text-align: center;
  color: #FF5722;
}

@media (max-width: 768px) {
  .container {
    padding: 0 15px;
  }
  .form-header,
  .form-footer {
    font-size: 1rem;
  }
  .form-body {
    max-height: calc(100vh - 150px);
  }
  .btn-primary,.btn-secondary {
        width: 100%;
    }
}
</style>
